// src/components/Home.js
import React from 'react';
import BoyWithSunglasses from './Image/3d-render-boy-with-orange-tshirt-sunglasses.jpg';
import Roadmap from './components/Roadmap'; // Import the Roadmap component
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <div className="about-me">
        <h2>About Me</h2>
        <p>Your about me content goes here...</p>
      </div>
      <Roadmap />
      <div className="grid-container">
        <div className="grid-item animated-image">
          <img src={BoyWithSunglasses} alt="3D Render Boy with Orange T-Shirt and Sunglasses" />
        </div>
        <div className="grid-item coding-work">
          <h2>Coding Work</h2>
          <p>Details about your coding projects go here...</p>
        </div>
        <div className="grid-item photographs">
          <h2>Photographs</h2>
          <p>Details about your photographs go here...</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
